import React from "react";
import DarkMode from "../DarkMode";
import styled from "styled-components";
import { Link } from "react-router-dom";

const AsideBar = styled.aside`
  position: relative;
  left: -510px;
`;

const Nav = styled.nav``;

const Ul = styled.ul`
  list-style: none;
`;

const ListTitle = styled.p`
  font-family: Lato;
  font-weight: 700;
  font-size: 18px;
  line-height: 21.6px;
  color: ${({ theme }) =>
    theme.isDarkMode ? "rgba(249, 249, 249, 0.67)" : "black"};
`;

const Li = styled.li`
  color: white;
`;
const StyledLink = styled(Link)`
  background-color: ${({ theme }) => (theme.isDarkMode ? "black" : "#fff")};
  color: ${({ theme }) => (theme.isDarkMode ? "#fff" : "black")};
`;

const Aside = () => {
  return (
    <AsideBar>
      <Nav>
        <Ul>
          <ListTitle>
            Menu <DarkMode />
          </ListTitle>
          <Li>
            <Link to="/">Home</Link>
          </Li>
          <Li>
            <Link to="/">Discover</Link>
          </Li>
          <Li>
            <Link to="/">Awards</Link>
          </Li>
          <Li>
            <Link to="/">Celebrities</Link>
          </Li>
        </Ul>
      </Nav>
    </AsideBar>
  );
};

export default Aside;
